import { GET_PANIER_BY_ID } from "../Action/types";

export default function userpanierReducer(state = [], action) {
  if (action.type === GET_PANIER_BY_ID) {
    console.log("panierid  reducer", action.payload);
    return action.payload;
  } else {
    return state;
  }
}
